import Navbar from '../static/Navbar'
import About from '../static/About';

export default function index() {
    return (
        <div>
            <style jsx>{`
                div {
                padding: 15px;
                display: inline-block;
                color: #82fa58;
                font: 50px menlo, monaco, monospace;
                background-color: #000;
                }

                .light {
                background-color: #999;
                }
            `}</style>
            <Navbar />
            <hr width="50%" />
            <About />
        </div>
    )
}
